import React from "react"
import Form from "./Form"


function Tide() {
    const lat = 60.936;
    const lng = 5.114;

    fetch(`https://api.stormglass.io/v2/tide/extremes/point?lat=${lat}&lng=${lng}&start=2019-03-15&end=2019-03-15`, {
        headers: {
            'Authorization': '9113fd22-c54b-11ec-8ccc-0242ac130002-9113fdea-c54b-11ec-8ccc-0242ac130002'
        }
    }).then((response) => response.json()).then((jsonData) => {
        <h1>{jsonData.height}</h1>
    });

    return (
        <>
            <h1>Tide</h1>
            <Form />



        </>
    )
}

export default Tide
